graphql.query:
mutation upsertDesignDecision($designDecision: DesignDecisionInput) {
  upsertDesignDecision(designDecision: $designDecision) {
    id
    name
    description
    createdAt
    updatedAt
    parentDesignDecisionID
    nonFunctionalConcerns {
      items {
        id
        scenario
        metric
      }
      nextToken
    }
    consequences {
      items {
        id
        description
        impact
      }
      nextToken
    }
    alternatives {
      items {
        id
        description
        name
      }
      nextToken
    }
    artifacts {
      items {
        id
        name
        description
        url
      }
      nextToken
    }
    context {
      id
      requirementRef
      description
      componentRef
    }
    metadata {
      id
      reporterName
      sourceRef
    }
  }
}

mutation createMetadata ($input: CreateMetadataInput!) {
    createMetadata (input: $input) {
        id
        reporterName
        sourceRef
        createdAt
        updatedAt
        metadataDesignDecisionId
    }
}

mutation updateMetadata ($input: UpdateMetadataInput!) {
    updateMetadata (input: $input) {
        id
        reporterName
        sourceRef
        createdAt
        updatedAt
        metadataDesignDecisionId
    }
}

mutation deleteMetadata ($input: DeleteMetadataInput!, $condition: ModelMetadataConditionInput) {
    deleteMetadata (input: $input, condition: $condition) {
        id
        reporterName
        sourceRef
        createdAt
        updatedAt
        metadataDesignDecisionId
    }
}

mutation createContext ($input: CreateContextInput!) {
    createContext (input: $input) {
