mutation updateDesignDecision ($input: UpdateDesignDecisionInput!) {
    updateDesignDecision (input: $input) {
        id
        name
        description
        createdAt
        updatedAt
        parentDesignDecisionID
        nonFunctionalConcerns {
            items {
                id
                scenario
                metric
            }
            nextToken
        }
        consequences {
            items {
                id
                description
                impact
            }
            nextToken
        }
        alternatives {
            items {
                id
                description
                name
            }
            nextToken
        }
        artifacts {
            items {
                id
                name
                description
                url
            }
            nextToken
        }
        context {
            id
            requirementRef
            description
            componentRef
        }
        metadata {
            id
            reporterName
            sourceRef
        }
    }
}

